import React from 'react';
import SearchBar from './searchbar'
function Home() {
  //add finding friends based on name here
  const FindFriends = (e) => {
    e.preventDefault();
  }
  //add finding photos based on tag here
  const FindPhotos = (e) => {
    e.preventDefault();
  }
  //add finding USERS based on comment text
  const FindComments = (e) => {
    e.preventDefault();
  }
    return (
        <div>
          <header>
            <h1>Welcome to PhotoShare</h1>
            <nav>
              <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">Explore</a></li>
                <li><a href="#">Notifications</a></li>
                <li><a href="/profile">Profile</a></li>
                <li><a href="/leaderboard">Leaderboard</a></li>
              </ul>
            </nav>
          </header>
          <h5>Search for Friends</h5>
          <SearchBar/>
          <button onClick={FindFriends}>Search</button>
          <main>
            <h2>Featured Photos</h2>
            <div className="featured-photos">
              {/* Display featured photos here */}
            </div>
            <h5>Search for Photos</h5>
            <SearchBar/>
            <button onClick={FindPhotos}>Search</button>
            <h5>Search for Comments</h5>
            <button onClick={FindComments}>Search</button>
            <SearchBar/>
            <h2>Latest Photos</h2>
            <div className="latest-photos">
              {/* Display latest photos here */}
            </div>
            <h2>Current Friends</h2>
            <div className="list-of-friends">
              {/* Display the user's current friends list */}
            </div>
            <h2>You May Also Like</h2>
            <div className="you-may-also-like">
              {/* Display photo recommendations based on tags */}
            </div>
          </main>
          <footer>
            <p>&copy; 2023 PhotoShare. All rights reserved.</p>
          </footer>
        </div>
      );
}
export default Home
